<!DOCTYPE html>
<html lang="id">
<head>
  <meta charset="UTF-8" />
  <title>Polling Real-Time | Yan</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <script src="https://www.gstatic.com/firebasejs/9.22.2/firebase-app-compat.js"></script>
  <script src="https://www.gstatic.com/firebasejs/9.22.2/firebase-database-compat.js"></script>
  <style>
    body {
      font-family: 'Segoe UI', sans-serif;
      background: #111;
      color: #fff;
      text-align: center;
      padding: 40px;
    }

    h1 {
      font-size: 32px;
      margin-bottom: 10px;
    }

    .poll {
      margin-top: 30px;
    }

    button {
      background: #00ffe0;
      color: #000;
      border: none;
      padding: 12px 25px;
      font-size: 16px;
      margin: 10px;
      border-radius: 8px;
      cursor: pointer;
      transition: background 0.3s ease;
    }

    button:hover {
      background: #00c9b8;
    }

    .results {
      margin-top: 40px;
    }

    .option {
      margin-bottom: 10px;
      font-size: 18px;
    }

    .bar {
      height: 20px;
      background: #00ffe0;
      margin-top: 5px;
      border-radius: 5px;
      transition: width 0.3s ease;
    }
  </style>
</head>
<body>

  <h3>MAINTENANCE</h3>
  

  <div class="poll">
    <button onclick="vote('cepetin')">Cepetin Bang</button>
    <button onclick="vote('santai')">Santai Aja</button>
  </div>

  <div class="results">
    <div class="option">
      Cepetin Bang: <span id="cepetinCount">0</span>
      <div class="bar" id="cepetinBar" style="width: 0%"></div>
    </div>
    <div class="option">
      Santai Aja: <span id="santaiCount">0</span>
      <div class="bar" id="santaiBar" style="width: 0%"></div>
    </div>
  </div>

  <script>
    
    const firebaseConfig = {
      apiKey: "AIzaSyBVMpOCjY9gdd4UkSa",
      authDomain: "yanofc-1ecd3.firebaseapp.com",
      databaseURL: "https://yanofc-1ecd3-default-rtdb.asia-southeast1.firebasedatabase.app",
      projectId: "yanofc-1ecd3",
      storageBucket: "yanofc-1ecd3.appspot.com",
      messagingSenderId: "843043156565",
      appId: "1:843043156565:web:e00942a837d30e4b4a9adc"
    };

    firebase.initializeApp(firebaseConfig);
    const db = firebase.database();

    function vote(option) {
      const ref = db.ref('poll/' + option);
      ref.transaction(current => (current || 0) + 1);
    }

function vote(option) {
  if (localStorage.getItem('voted')) {
    alert("Kamu sudah voting!");
    return;
  }

  const ref = db.ref('poll/' + option);
  ref.transaction(current => (current || 0) + 1);
  localStorage.setItem('voted', 'true');
}

    function updateUI(snapshot) {
      const data = snapshot.val() || {};
      const total = (data.cepetin || 0) + (data.santai || 0);

      const c = data.cepetin || 0;
      const s = data.santai || 0;

      document.getElementById('cepetinCount').textContent = c;
      document.getElementById('santaiCount').textContent = s;

      const cp = total ? (c / total) * 100 : 0;
      const sp = total ? (s / total) * 100 : 0;

      document.getElementById('cepetinBar').style.width = cp + '%';
      document.getElementById('santaiBar').style.width = sp + '%';
    }

    db.ref('poll').on('value', updateUI);
  </script>
</body>
